import React, { useState } from 'react'

const Prices = ({ bpi }) => {
    console.log(bpi);
    return (
        <div>
            <ul className="list-group">
                <li className="list-group-item">
                    Bitcoin rate for {bpi.description} : <span className="badge badge-primary">{bpi.code}</span> <strong>{bpi.rate}</strong>
                </li>
            </ul>
        </div>
    )
}

export default Prices
